import Vue from 'vue';
import Vuelidate from 'vuelidate';
import 'bootstrap';
import App from './App.vue';
import router from './router.js';
import store from './store/index.js';
import { library } from '@fortawesome/fontawesome-svg-core'
import { FontAwesomeIcon } from '@fortawesome/vue-fontawesome'
import { faCaretLeft,faSpinner, faAlignLeft,faCaretRight,faPhoneAlt,faQuestion } from '@fortawesome/free-solid-svg-icons'
import {faFacebookSquare,faGoogle} from '@fortawesome/free-brands-svg-icons'
// import VueSession from 'vue-session'
// import VueSidebarMenu from '../src/components/SidebarMenu.vue'


library.add(faCaretLeft,faSpinner, faAlignLeft,faCaretRight,faFacebookSquare,faGoogle,faPhoneAlt,faQuestion)
Vue.component('font-awesome-icon', FontAwesomeIcon)
Vue.config.productionTip = false;
// dom.watch();
Vue.use(Vuelidate);
// Vue.use(VueSidebarMenu);
// Vue.use(VueSession)

Vue.component('font-awesome-icon', FontAwesomeIcon)

new Vue({
  router,
  store,
  render: h => h(App)
}).$mount('#app');
